import React from 'react';

export const Button = () => {
    return (
        <button className='text-sm sm:text-base text-center relative w-full border rounded placeholder-gray-400 focus:border-indigo-400 focus:outline-none py-2 pr-2' type="text" onChange={this.onChange}>
        </button>
    );
};

export default Button;
